description:
«ZET-MOBILE» – официальное мобильное приложение для смартфонов от компании ООО «ТАКОМ».

С приложением «ZET-MOBILE» решай любые вопросы, связанные с мобильной связью, в удобное время и в любом месте.

• Проверяй баланс счета, остаток минут, смс и интернет-трафика;
• Контролируй расходы в удобном формате прямо в приложении;
• Переводи минуты, мегабайты и смс с услугой «Трансфер»;
• Переход на другой тарифный план, доступный к подключению в один клик;
• Подключай и отключай услуги, их стоимость указана в приложении;
• Получай детализированный отчет о расходах на email.

В процессе авторизации в личном кабинете необходимо ввести полученный в SMS-сообщении код. После авторизации в личном кабинете рекомендуем установить надежный пароль.

* При загрузке, обновления «ZET-MOBILE» интернет-трафик оплачивается согласно условиям вашего тарифа. Загрузка и работа в международном роуминге оплачиваются согласно роуминговым тарифам на мобильный интернет.

Все ваши замечания и предложения, касательно работы приложения, вы можете отправить на product@zet-mobile.com. Все отзывы внимательно изучаются.

Спасибо, что Вы с нами! С уважением Ваш ZET-MOBILE.
